import React from 'react';
import Menu from './Menu';
import Footer from './Footer';
import Navbar from './Navbar';

const Layout = (props) => {
  return (
    <>
      <header>
        <Navbar />
      </header>

      <main>
        <div className='container'>{props.children}</div>
      </main>
      <Footer />
    </>
  );
};

export default Layout;
